import {RcmHeaderWrapper,RcmHeaderLeft} from './style';

function ThemeHeaderRmc(props){

    return (
        <RcmHeaderWrapper>
            <RcmHeaderLeft>
                <h2 className='title'>
                    <a href='/discover/recommend'>
                        {props.title}
                    </a>
                </h2>
            </RcmHeaderLeft>
        </RcmHeaderWrapper>
    );
}

ThemeHeaderRmc.propTypes = {
    // title属性必填
    title: propTypes.string.isRequired,
}

ThemeHeaderRmc.defaultProps = {
    keywords: []
}

export default ThemeHeaderRmc;
